import { CartContext } from "./storage/CartContext";
import CartModal from "./components/CartModal/CartModal";
function App() {
  const ctx=useContext(CartContext)
  return (
    <>
      <ctxCartModal />
      <Header></Header>
      <MainBanner></MainBanner>
      <MealsList></MealsList>
    </>
  );
}

export default App;
